CREATE TABLE `EVENT_REG` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `participant_name` varchar(50) NOT NULL,
  `college_name` varchar(50) NOT NULL,
  `group_t` varchar(10) NOT NULL,
  `category` varchar(10) NOT NULL,
  `event_id` int(5) DEFAULT NULL,
  `user_id` int(5) DEFAULT NULL,
  `has_paid` tinyint(1) DEFAULT '0',
  `volunteer_id` int(11) DEFAULT NULL,
  `no_of_participants` int(11) NOT NULL DEFAULT '1',
  `amt_recvd` float NOT NULL DEFAULT '0',
  `payment_details` varchar(50) DEFAULT NULL,
  `name2` varchar(50) DEFAULT NULL,
  `phone2` varchar(12) DEFAULT NULL,
  `name3` varchar(50) DEFAULT NULL,
  `name4` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `EVENT_REG_EVENT_event_id_fk` (`event_id`),
  KEY `EVENT_REG_WEB_USER_user_id_fk` (`user_id`),
  CONSTRAINT `EVENT_REG_EVENT_event_id_fk` FOREIGN KEY (`event_id`) REFERENCES `EVENT` (`event_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `EVENT_REG_WEB_USER_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `WEB_USER` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE
