INSERT INTO `NEWS_FEED` VALUES (15,'Competetive Coding','Showcase your logical and coding skills in this straightforward coding competition. The task is simple: code to win!\r\nContact:\r\nSanved Joshi 8669053434 ','2019-02-23 00:00:00','2019-02-24 00:00:00',1043),(17,'Lets Debug','Identify the problem, correct it, find a way around it. Thatâ??s all it takes to win!\r\nEntry Fee: 50 per team.\r\nContact:\r\nShivani Rajmane 7218867653 ','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(18,'QR Hunt','QR hunt basically aims at finding the clues which will be encoded in the QR codes. \r\nContact:\r\nPrajwal Chandak 8928863738','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(19,'NINJA Coding','Often you must have scratched your head to find out logical relationship between numbers. \r\nContact:\r\nSrushti Pawar 7387955702','2019-02-23 00:00:00','2019-02-24 00:00:00',1043),(20,'GOOGLER','Come and challenge yourselves in a competition that may look easy but has whole lot of twists for you!\r\nContact: Onkar Bhujbal 8446320691 ','2019-02-23 00:00:00','2019-02-24 00:00:00',1043),(21,'DATA MAESTRO','Participate here to learn and compete!','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(22,'Reverse Coding','If you think you have the skills to solve logical questions fast and find patterns easily, reverse coding is the perfect competition for you. \r\nContact:Vedang Kapse 9130288307 ','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(23,'Games - PUBG','Pubg Game\r\nSwaraj Dhondge 9503422604 ','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(24,'Games - NFS MW','Most Wanted competition','2019-02-23 00:00:00','2019-02-23 00:00:00',1043),(25,'Games - FIFA','1v1 matches, halves of 4 minutes each','2019-02-23 00:00:00','2019-02-24 00:00:00',1043),(26,'DAVE / Mario / Subway Surfers',' Winners based on fastest time/best score. ','2019-02-23 00:00:00','2019-02-24 00:00:00',1043),(27,'Games - NFS MW','Compete in a LAN game game of 4 or go for the best time on NFS world map.','